import Link from 'next/link'

function Navbar() {
  return (
    <>
      <h1>My App</h1>
      <Link href="/">Home</Link>
      <Link href="/About">About</Link>
      <Link href="/Api">API</Link>
    </>);
}

export default Navbar;
